import{_ as t,o as e,c as n,a as l}from"./app.70c7d90c.js";const u=JSON.parse('{"title":"Web \u6027\u80FD\u6307\u6807","description":"","frontmatter":{},"headers":[{"level":2,"title":"FP\uFF08Fist Paint\uFF09","slug":"fp\uFF08fist-paint\uFF09","link":"#fp\uFF08fist-paint\uFF09","children":[]},{"level":2,"title":"FCP\uFF08\u200BFirst Contentful Paint\uFF09","slug":"fcp\uFF08\u200Bfirst-contentful-paint\uFF09","link":"#fcp\uFF08\u200Bfirst-contentful-paint\uFF09","children":[]},{"level":2,"title":"LCP (Largest Contentful Paint)","slug":"lcp-largest-contentful-paint","link":"#lcp-largest-contentful-paint","children":[]},{"level":2,"title":"FID (First Input Delay)","slug":"fid-first-input-delay","link":"#fid-first-input-delay","children":[]},{"level":2,"title":"TTI (Time to Interactive)","slug":"tti-time-to-interactive","link":"#tti-time-to-interactive","children":[]},{"level":2,"title":"CLS (Cumulative Layout Shift)","slug":"cls-cumulative-layout-shift","link":"#cls-cumulative-layout-shift","children":[]},{"level":2,"title":"\u53C2\u8003","slug":"\u53C2\u8003","link":"#\u53C2\u8003","children":[]}],"relativePath":"knowledge/browser/vitals.md"}'),a={name:"knowledge/browser/vitals.md"},i=l('<h1 id="web-\u6027\u80FD\u6307\u6807" tabindex="-1">Web \u6027\u80FD\u6307\u6807 <a class="header-anchor" href="#web-\u6027\u80FD\u6307\u6807" aria-hidden="true">#</a></h1><p>\u8FD9\u4E5F\u662F\u8C37\u6B4C\u6307\u5B9A\u7684 web \u6027\u80FD\u6307\u6807\u6807\u51C6, \u8C37\u6B4C\u8BA4\u4E3A\u4E4B\u524D\u7684\u6807\u51C6\u592A\u590D\u6742\uFF0C\u6307\u6807\u592A\u591A\u4E86\uFF0C\u5728 2020 \u5E74\u91CD\u65B0\u8FDB\u884C\u4E86\u68B3\u7406\uFF0C\u7B80\u5316\u5230\u4E86\u4E09\u4E2A\u3002</p><ul><li>\u52A0\u8F7D\u6027\u80FD LCP</li><li>\u4EA4\u4E92\u6027 FID</li><li>\u89C6\u89C9\u7A33\u5B9A\u6027 CLS</li></ul><h2 id="fp\uFF08fist-paint\uFF09" tabindex="-1">FP\uFF08Fist Paint\uFF09 <a class="header-anchor" href="#fp\uFF08fist-paint\uFF09" aria-hidden="true">#</a></h2><p>\u8BB0\u5F55\u9875\u9762<strong>\u7B2C\u4E00\u6B21\u7ED8\u5236\u50CF\u7D20</strong>\u7684\u65F6\u95F4\uFF08<strong>\u767D\u5C4F\u65F6\u95F4</strong>\uFF09\uFF0C\u6B64\u65F6 DOM \u5185\u5BB9\u8FD8\u6CA1\u5F00\u59CB\u7ED8\u5236\uFF0C\u53EF\u80FD\u9700\u8981\u6587\u4EF6\u4E0B\u8F7D\u3001\u89E3\u6790\u7B49\u8FC7\u7A0B</p><h2 id="fcp\uFF08\u200Bfirst-contentful-paint\uFF09" tabindex="-1">FCP\uFF08\u200BFirst Contentful Paint\uFF09 <a class="header-anchor" href="#fcp\uFF08\u200Bfirst-contentful-paint\uFF09" aria-hidden="true">#</a></h2><p><img src="https://limy-1309594960.cos.ap-beijing.myqcloud.com/202303051553788.png" alt="" data-__preview__="true"></p><p>\u200B<strong>\u9996\u6B21\u5185\u5BB9\u7ED8\u5236</strong>\uFF08<strong>\u9996\u5C4F\u65F6\u95F4</strong>\uFF09\uFF0C\u6D4F\u89C8\u5668\u9996\u6B21\u7ED8\u5236\u6765\u81EA DOM \u7684\u5185\u5BB9\u7684\u65F6\u95F4\uFF0C\u5185\u5BB9\u5FC5\u987B\u5305\u62EC\u6587\u672C\uFF0C\u56FE\u7247\uFF0C\u975E\u767D\u8272\u7684 canvas \u6216 svg\uFF0C\u4E5F\u5305\u62EC\u5E26\u6709\u6B63\u5728\u52A0\u8F7D\u4E2D\u7684 web \u5B57\u4F53\u6587\u672C\u3002\u8FD9\u662F\u7528\u6237\u7B2C\u4E00\u6B21\u770B\u5230\u7684\u5185\u5BB9\u3002\uFF0C\u53EA\u6709\u5F53 DOM \u5185\u5BB9\u53D1\u751F\u53D8\u5316\u624D\u4F1A\u89E6\u53D1</p><table><thead><tr><th style="text-align:center;">FCP \u65F6\u95F4(\u79D2)</th><th style="text-align:center;">\u989C\u8272\u7F16\u7801</th><th style="text-align:center;">FPC \u5206\u6570</th></tr></thead><tbody><tr><td style="text-align:center;">0 - 2</td><td style="text-align:center;">\u7EFF\u8272(\u5FEB)</td><td style="text-align:center;">75 - 100</td></tr><tr><td style="text-align:center;">2 - 4</td><td style="text-align:center;">\u6A59\u8272(\u4E2D\u7B49)</td><td style="text-align:center;">50 - 74</td></tr><tr><td style="text-align:center;">\u8D85\u8FC7 4</td><td style="text-align:center;">\u7EA2\u8272(\u6162)</td><td style="text-align:center;">0 - 49</td></tr></tbody></table><h2 id="lcp-largest-contentful-paint" tabindex="-1">LCP (Largest Contentful Paint) <a class="header-anchor" href="#lcp-largest-contentful-paint" aria-hidden="true">#</a></h2><p><img src="https://limy-1309594960.cos.ap-beijing.myqcloud.com/202303051554563.png" alt="" data-__preview__="true"></p><p><strong>\u6700\u5927\u5185\u5BB9\u7ED8\u5236</strong>\uFF0C\u53EF\u89C6\u533A\u57DF\u4E2D\u6700\u5927\u7684\u5185\u5BB9\u5143\u7D20\u5448\u73B0\u5230\u5C4F\u5E55\u4E0A\u7684\u65F6\u95F4\uFF0C\u7528\u4EE5\u4F30\u7B97\u9875\u9762\u7684\u4E3B\u8981\u5185\u5BB9\u5BF9\u7528\u6237\u7684\u53EF\u89C1\u65F6\u95F4\u3002img \u56FE\u7247\uFF0Cvideo \u5143\u7D20\u7684\u5C01\u9762\uFF0C\u901A\u8FC7 url \u52A0\u8F7D\u5230\u7684\u80CC\u666F\uFF0C\u6587\u672C\u8282\u70B9\u7B49\u3002</p><table><thead><tr><th style="text-align:center;">LCP \u65F6\u95F4(\u79D2)</th><th style="text-align:center;">\u989C\u8272\u7F16\u7801</th></tr></thead><tbody><tr><td style="text-align:center;">0 - 2.5</td><td style="text-align:center;">\u7EFF\u8272(\u5FEB)</td></tr><tr><td style="text-align:center;">2.5 - 4</td><td style="text-align:center;">\u6A59\u8272(\u4E2D\u7B49)</td></tr><tr><td style="text-align:center;">\u8D85\u8FC7 4</td><td style="text-align:center;">\u7EA2\u8272(\u6162)</td></tr></tbody></table><h2 id="fid-first-input-delay" tabindex="-1">FID (First Input Delay) <a class="header-anchor" href="#fid-first-input-delay" aria-hidden="true">#</a></h2><p><img src="https://limy-1309594960.cos.ap-beijing.myqcloud.com/202303051605740.png" alt="" data-__preview__="true"></p><p><strong>\u9996\u6B21\u8F93\u5165\u5EF6\u8FDF</strong>\uFF0C\u4ECE\u7528\u6237\u7B2C\u4E00\u6B21\u4E0E\u9875\u9762\u8FDB\u884C\u4EA4\u4E92\u5230\u6D4F\u89C8\u5668\u5B9E\u9645\u80FD\u591F\u54CD\u5E94\u8BE5\u4EA4\u4E92\u7684\u65F6\u95F4\uFF0C\u8F93\u5165\u5EF6\u8FDF\u662F\u56E0\u4E3A\u6D4F\u89C8\u5668\u7684\u4E3B\u7EBF\u7A0B\u6B63\u5FD9\u4E8E\u505A\u5176\u4ED6\u4E8B\u60C5\uFF0C\u6240\u4EE5\u4E0D\u80FD\u54CD\u5E94\u7528\u6237\uFF0C\u53D1\u751F\u8FD9\u79CD\u60C5\u51B5\u7684\u4E00\u4E2A\u5E38\u89C1\u539F\u56E0\u662F\u6D4F\u89C8\u5668\u6B63\u5FD9\u4E8E\u89E3\u6790\u548C\u6267\u884C\u5E94\u7528\u7A0B\u5E8F\u52A0\u8F7D\u7684\u5927\u91CF\u8BA1\u7B97\u7684 <code>JavaScript</code>\u3002</p><table><thead><tr><th style="text-align:center;">FID \u65F6\u95F4(\u6BEB\u79D2)</th><th style="text-align:center;">\u989C\u8272\u7F16\u7801</th></tr></thead><tbody><tr><td style="text-align:center;">0 - 100</td><td style="text-align:center;">\u7EFF\u8272(\u5FEB)</td></tr><tr><td style="text-align:center;">100 - 300</td><td style="text-align:center;">\u6A59\u8272(\u4E2D\u7B49)</td></tr><tr><td style="text-align:center;">\u8D85\u8FC7 300</td><td style="text-align:center;">\u7EA2\u8272(\u6162)</td></tr></tbody></table><h2 id="tti-time-to-interactive" tabindex="-1">TTI (Time to Interactive) <a class="header-anchor" href="#tti-time-to-interactive" aria-hidden="true">#</a></h2><p><strong>\u5B8C\u5168\u8FBE\u5230\u53EF\u4EA4\u4E92</strong>\u72B6\u6001\u7684\u65F6\u95F4\u70B9\uFF0C\u6D4F\u89C8\u5668\u5DF2\u7ECF\u53EF\u4EE5\u6301\u7EED\u7684\u54CD\u5E94\u7528\u6237\u7684\u8F93\u5165\uFF0C\u5B8C\u5168\u8FBE\u5230\u53EF\u4EA4\u4E92\u7684\u72B6\u6001\u7684\u65F6\u95F4\u662F\u5728\u6700\u540E\u4E00\u4E2A\u957F\u4EFB\u52A1\u5B8C\u6210\u7684\u65F6\u95F4\uFF0C\u5E76\u4E14\u5728\u968F\u540E\u7684 5s \u5185\u7F51\u7EDC\u548C\u4E3B\u7EBF\u7A0B\u662F\u7A7A\u95F2\u7684</p><table><thead><tr><th style="text-align:center;">TTI \u65F6\u95F4(\u79D2)</th><th style="text-align:center;">\u989C\u8272\u7F16\u7801</th></tr></thead><tbody><tr><td style="text-align:center;">0 - 3.8</td><td style="text-align:center;">\u7EFF\u8272(\u5FEB)</td></tr><tr><td style="text-align:center;">3.9 - 7.3</td><td style="text-align:center;">\u6A59\u8272(\u4E2D\u7B49)</td></tr><tr><td style="text-align:center;">\u8D85\u8FC7 7.3</td><td style="text-align:center;">\u7EA2\u8272(\u6162)</td></tr></tbody></table><h2 id="cls-cumulative-layout-shift" tabindex="-1">CLS (Cumulative Layout Shift) <a class="header-anchor" href="#cls-cumulative-layout-shift" aria-hidden="true">#</a></h2><p><img src="https://limy-1309594960.cos.ap-beijing.myqcloud.com/202303051602919.png" alt="" data-__preview__="true"></p><p><strong>\u7D2F\u8BA1\u5E03\u5C40\u4F4D\u79FB</strong>\uFF0CCLS \u4F1A\u6D4B\u91CF\u5728\u9875\u9762\u6574\u4E2A\u751F\u547D\u5468\u671F\u4E2D\u53D1\u751F\u7684\u6BCF\u4E2A\u610F\u5916\u7684\u5E03\u5C40\u79FB\u4F4D\u7684\u6240\u6709\u5355\u72EC\u5E03\u5C40\u79FB\u4F4D\u5206\u6570\u7684\u603B\u548C\uFF0C\u4ED6\u662F\u4E00\u79CD\u4FDD\u8BC1\u9875\u9762\u7684\u89C6\u89C9\u7A33\u5B9A\u6027\u4ECE\u800C\u63D0\u5347\u7528\u6237\u4F53\u9A8C\u7684\u6307\u6807\u65B9\u6848\u3002</p><table><thead><tr><th style="text-align:center;">CLS \u65F6\u95F4(\u6BEB\u79D2)</th><th style="text-align:center;">\u989C\u8272\u7F16\u7801</th></tr></thead><tbody><tr><td style="text-align:center;">0 - 0.1</td><td style="text-align:center;">\u7EFF\u8272(\u5FEB)</td></tr><tr><td style="text-align:center;">0.1 - 0.25</td><td style="text-align:center;">\u6A59\u8272(\u4E2D\u7B49)</td></tr><tr><td style="text-align:center;">\u8D85\u8FC7 0.25</td><td style="text-align:center;">\u7EA2\u8272(\u6162)</td></tr></tbody></table><h2 id="\u53C2\u8003" tabindex="-1">\u53C2\u8003 <a class="header-anchor" href="#\u53C2\u8003" aria-hidden="true">#</a></h2><ul><li><a href="https://juejin.cn/post/6974565176427151397" target="_blank" rel="noreferrer">https://juejin.cn/post/6974565176427151397</a></li><li><a href="https://juejin.cn/post/6961968596805222407" target="_blank" rel="noreferrer">https://juejin.cn/post/6961968596805222407</a></li></ul>',26),r=[i];function d(s,c,h,o,g,p){return e(),n("div",null,r)}const f=t(a,[["render",d]]);export{u as __pageData,f as default};
